import React from "react";
import "./style.css";

export default function Roadmap() {
  return (
    <div className="roadmap" id="roadmap">
      <h1 className="gradient-heading">
        Roadmap <span>2022</span>
      </h1>
      <img draggable="false" src="images/roadmap_1.png" alt="roadmap" />
    </div>
  );
}
